import 'package:dio/dio.dart';import 'package:newsapp/model/artical.dart';class ApiService {  final Dio dio = Dio();  Future<List<ArticalModel>> get() async {    var response = await dio.get(        "https://newsapi.org/v2/top-headlines?country=us&apiKey=6b0c10e58ff54f4caa1e9f252329dc30");    Map<String, dynamic> json = response.data;    List<ArticalModel> articles = [];    for (var item in json["articles"]) {    articles.add(ArticalModel(title: item["title"], description: item["description"], url: item["url"], urlToImage: item["urlToImage"]));    }    return articles;  }  }